window.bookSummaryJSON = "<p><b>A magic apocalypse. Refugees from Earth. A new world. Elves, orcs, and dragons!</b></p> <p>Portals from Overworld have appeared on Earth, and beings intent on conscripting humanity into the mysterious Trials have invaded.</p> <p><b>Earth is doomed. Humanity has been exiled. Can Jamie save mankind?</b></p> <p>Jamie Sinclair, a young man with unique gifts, must find a way for his family and friends to survive Earth's destruction and build a new home in Overworld.</p> <p><b>The Trials is not a game. Will Jamie survive its challenges?</b></p> <p>Join Jamie as he struggles through the brutal Trials while wrestling with his new magics and Overworld's game-like dynamics.</p> <p><b>A fantasy post-apocalyptic survival story of one man's journey to save humanity.</b></p>"; 
